//keeng.vn/album/remix-hit-song-1-dinh-kien-phong/71kFthwH.html",image_path:"/sata11/images/tintuc/2017/02/03/mAPVnQrG8YOPOX9gj8lG58943280b4e63.jpg"}],feelings:[{title:"Em có thể tiến 1000 bước đến gặp anh thì cũng sẵn sàng lui 1001 bước để xa anh",header:"Em rất yêu anh, có thể vì anh mà hy sinh nhiều chuyện, thế nhưng vì anh không trân trọng em, không trân trọng tình yêu này, nên em sẽ rời xa anh mãi mãi.",main_thumb_path:"/sata11/images/tintuc/2017/02/08/klagCg4UGfRACH7KpgyY589a8f9d2234f.jpg",slug:"em-co-the-tien-1000-buoc-den-gap-anh-thi-cung-san-sang-lui-1001-buoc-de-xa-anh-2",content_add:"1"},{title:"Anh có còn cơ hội để quay về bên em nữa không?",header:"Là bởi vì anh cố chấp, là bởi vì anh nghĩ chuyện tình yêu cũng có thể dùng lý trí để điều khiển, nhưng hóa ra anh đã sai, sai thật rồi em ạ.",main_thumb_path:"/sata11/images/tintuc/2017/02/06/kVAA3PVCZlZAJRXERbx85897e03e29454.jpg",slug:"anh-co-con-co-hoi-de-quay-ve-ben-em-nua-khong-2",content_add:"1"},{title:"Đã đến lúc anh và em nên cho mối quan hệ này một danh phận",header:"Đã đến lúc nên cho mối quan hệ này một danh phận, anh nhỉ? Nhưng nếu em chọn tiến một bước thì anh có thể bên em? Nếu em chọn lùi xa thì anh có muốn giữ em ở lại?",main_thumb_path:"/sata11/images/tintuc/2017/02/03/92dqgWH5BmcuwzzKdHqy5893ee646b40d.jpg",slug:"da-den-luc-anh-va-em-nen-cho-moi-quan-he-nay-mot-danh-phan",content_add:"1"},{title:"Đừng cưới vì bố mẹ giục, cũng đừng cưới vì cô đơn",header:"Bạn sẽ làm gì khi đến tuổi mà vẫn chưa có người để cùng nắm tay đến cuối đường? Chờ nhân duyên đến hay 'vơ tạm' một người rồi nhắm mắt chờ vận may?",main_thumb_path:"/sata11/images/tintuc/2017/01/20/ilFinDf9SLsbALMFcGMo5881c22025d0c.jpg",slug:"dung-cuoi-vi-bo-me-giuc-cung-dung-cuoi-vi-co-don",content_add:"1"}],rankingvn:[{id:2856400,name:"Bao Giờ Lấy Chồng",video_id:null,video_info:null,lyric:"<p>Năm mới lại đến em vẫn lẻ b&oacute;ng một m&igrave;nh<br />\r\nM&agrave; đ&acirc;u l&agrave;m sao v&igrave; em đ&atilde; c&oacute; gia đ&igrave;nh<br />\r\nMẹ cha chờ em về qu&ecirc; ăn Tết linh đ&igrave;nh<br />\r\nTay x&aacute;ch h&agrave;nh l&yacute; miệng em cười vẫn tươi xinh</p>\r\n\r\n<p>Đường qu&ecirc; n&agrave;y ngay cũng kh&ocirc;ng g&igrave; kh&aacute;c năm xưa<br />\r\nVẫn đấy chợ phi&ecirc;n người ta chen ch&uacute;c đẩy đưa<br />\r\nVề đến nh&agrave; vui l&agrave;m sao kể hết cho vừa<br />\r\nMẹ em ra đ&oacute;n hỏi ngay: Chịu lấy chồng chưa?</p>\r\n\r\n<p>Nụ cười chợt tho&aacute;ng vụt tắt tr&ecirc;n m&aacute; hồng<br />\r\nEm n&agrave;o đ&acirc;u muốn lấy chồng<br />\r\nEm chỉ muốn ở m&atilde;i với mẹ cha<br />\r\nMỗi năm Tết đến em mới về qu&ecirc; nh&agrave;<br />\r\nNấu b&aacute;nh mứt tặng &ocirc;ng b&agrave;<br />\r\nGiao thừa qu&acirc;y quần b&ecirc;n cả nh&agrave; ta</p>\r\n\r\n<p>Đừng ai hỏi em chuyện lấy chồng x2<br />\r\nM&ugrave;a xu&acirc;n n&agrave;y em chưa lấy chồng<br />\r\nEm vẫn chưa muốn lấy chồng</p>\r\n\r\n<p>Đầu năm c&ugrave;ng cha mẹ đi mừng Tết &ocirc;ng b&agrave;<br />\r\nC&ocirc; ch&uacute; ai nấy đều hỏi con ế rồi &agrave;?<br />\r\nBạn trai đ&atilde; c&oacute; chưa sao chẳng dắt về nh&agrave;<br />\r\nTrời ơi một c&acirc;u m&agrave; ai cũng hỏi vậy ta?<br />\r\nĐ&atilde; lấy chồng chưa?</p>\r\n\r\n<p>Nụ cười chợt tho&aacute;ng vụt tắt tr&ecirc;n m&aacute; hồng<br />\r\nEm n&agrave;o đ&acirc;u muốn lấy chồng<br />\r\nEm chỉ muốn ở m&atilde;i với mẹ cha</p>\r\n\r\n<p>Mỗi năm Tết đến em mới về qu&ecirc; nh&agrave;<br />\r\nNấu b&aacute;nh mứt tặng &ocirc;ng b&agrave;<br />\r\nGiao thừa qu&acirc;y quần b&ecirc;n cả nh&agrave; ta<br />\r\nĐừng ai hỏi em chuyện lấy chồng x2<br />\r\nM&ugrave;a xu&acirc;n n&agrave;y em chưa lấy chồng<br />\r\nEm vẫn chưa muốn lấy chồng</p>",is_active:1,listen_no:1551064,listen_no_day:null,listen_no_week:null,path:"/sata04/songv3/2017/01/16/nmdfP7YU1j8kJvpfpe9g587c77f02ec1f.mp3",user_creator_id:null,like_no:null,download_no:28475,published_time:"2017-01-19 08:00:00",bit_rate:320,name_unsign:"Bao Gio Lay Chong",lyric_unsign:"",identify:"kOdgCf